async function fetchSuppliersForAllTypes() {
    const types = [{
        type: "us_based_telehealth",
        label: "Online Clinics"
    }, {
        type: "international_telehealth",
        label: "International Online Clinics"
    }, {
        type: "websites_that_sell_pills",
        label: "Websites that sell pills"
    }, {
        type: "community_networks",
        label: "Community Networks"
    }, ];

    const fetchPromises = types.map( (typeObj) => {
        const specificPayload = {
            ...payload
        };
        specificPayload.type_and_amount.type = typeObj.type;
        specificPayload.type_and_amount.amount = ITEMS_INCREMENT;
        return fetchSuppliers(specificPayload, false, false).then( (data) => ({
            type: typeObj.type,
            label: typeObj.label,
            data,
        }));
    }
    );

    const results = await Promise.all(fetchPromises);
    handleFetchedData(results);
}

function handleFetchedData(responseData) {
    const container = document.querySelector(".states_result_component-wrapper.is-main .states_result_component");
    if (!container) {
        console.error("Container element not found.");
        return;
    }
    container.innerHTML = "";

    let totalShowing = 0;
    let totalTotal = 0;

    responseData.forEach( ({type, label, data}) => {
        if (data && data.items && data.items.length > 0) {
            totalShowing += data.itemsReceived;
            totalTotal += data.itemsTotal;

            if (!counter.hasOwnProperty(type)) {
                counter[type].showing = data.itemsReceived;
            } else {
                counter[type].total += data.itemsReceived;
            }

            const section = document.createElement("div");
            section.className = "provider-section";
            section.id = "provider-section-" + type;
            section.style.display = "contents";
            container.appendChild(section);

            const items = transformData(data.items);
            if (payload.sorting.sortColumn !== "price_integer" && payload.sorting.sortColumn !== "delivery_integer") {
                items.sort( (a, b) => sortItems(a, b));
            }

            items.forEach( (item) => {
                const row = createNewRow(item, svgIcons);
                section.appendChild(row);
            }
            );

            counter[type] = {
                showing: data.itemsReceived,
                total: data.itemsTotal,
            };

            if (data.itemsReceived < data.itemsTotal) {
                const loadMoreBtn = createLoadMoreButton({
                    type: type,
                    loadMoreLabel: `MORE ${label.toUpperCase()}`,
                });
                section.appendChild(loadMoreBtn);
            }
        }
    }
    );
    counter.all.showing = totalShowing;
    counter.all.total = totalTotal;
    // Update overall results based on the sum across provider types.
    updateOverallCounters(totalShowing, totalTotal);
    appendBackToTopButton();
    attachRowListeners();
}

// Update fetchSuppliers to handle API requests for specific provider types
async function fetchSuppliers(payload, loadMoreFetch=false, updateUI=true) {
    const baseUrl = "https://x5y9-ip6q-ykpo.n7c.xano.io/api:t1-Xws3y/suppliers/paginated?";
    const queryParams = new URLSearchParams({
        looking_for: payload.looking_for,
        state: payload.state,
        password: "vbRUJPQBWQWDNTK!yPo9yvJ",
    });

    const additionalParams = ["type_and_amount", "language", "sorting", "accepts_insurance", "accepts_medicaid", "discounts_available", "no_face_interaction", "extra_misoprostol_included", ];
    additionalParams.forEach( (param) => {
        if (payload[param]) {
            queryParams.append(param, JSON.stringify(payload[param]));
        }
    }
    );

    const url = `${baseUrl}${queryParams.toString()}`;
    const requestOptions = {
        method: "GET",
        redirect: "follow",
    };

    try {
        const response = await fetch(url, requestOptions);
        if (!response.ok)
            throw new Error("Failed to fetch suppliers");
        const data = await response.json();
        if (updateUI) {
            handleNewData(data, loadMoreFetch);
        }
        return data;
    } catch (error) {
        throw new Error(error);
    }
}

function handleNewData(data, isLoadMoreFetch=false) {
    const container = document.querySelector(".states_result_component-wrapper.is-main .states_result_component");
    if (!container) {
        console.error("Container element not found.");
        return;
    }

    // Determine if we are in flat mode (sort by price/delivery) or grouped mode.
    const flatMode = payload.sorting.sortColumn === "price_integer" || payload.sorting.sortColumn === "delivery_integer";

    // ----------------------------
    // FLAT MODE (Price/Delivery Sort)
    // ----------------------------
    if (flatMode) {
        // For flat mode, we expect the API to return a combined, cumulative result.
        // If this is a load-more call, update the global count by the difference.
        if (isLoadMoreFetch) {
            const newItemsCount = data.itemsReceived - counter.all.showing;
            // Only add if positive
            if (newItemsCount > 0) {
                counter.all.showing += newItemsCount;
            }
        } else {
            // On initial flat mode fetch (switching modes), if global count is zero, set it.
            if (counter.all.showing === 0) {
                counter.all.showing = data.itemsReceived;
                counter.all.total = data.itemsTotal;
            }
        }

        // Clear the container and render flat-mode rows.
        container.innerHTML = "";
        let rowItems = transformData(data.items);
        // Sort rows by our fixed provider order.
        if (payload.sorting.sortColumn === "price_integer") {
  rowItems.sort((a, b) => a.price_integer - b.price_integer);
} else if (payload.sorting.sortColumn === "delivery_integer") {
  rowItems.sort((a, b) => a.delivery_integer - b.delivery_integer);
} else {
  rowItems.sort(
    (a, b) => providerOrder.indexOf(a.type) - providerOrder.indexOf(b.type)
  );
}

        rowItems.forEach( (item) => {
            container.appendChild(createNewRow(item, svgIcons));
        }
        );

        // If more items exist, append a load-more button for flat mode.
        if (data.itemsReceived < data.itemsTotal) {
            const loadMoreBtn = createLoadMoreButton({
                type: "all",
                loadMoreLabel: "MORE PROVIDERS",
            });
            container.appendChild(loadMoreBtn);
        }

        // Do not update grouped state in flat mode.
        updateOverallCounters();
        appendBackToTopButton();
        attachRowListeners();
        return;
    }

    // ----------------------------
    // GROUPED MODE (Provider Mode)
    // ----------------------------
    // In grouped mode, payload.type_and_amount.type is one of the provider keys.
    const providerKey = payload.type_and_amount.type;

    // Get or create the section for this provider.
    let section = document.getElementById("provider-section-" + providerKey);
    if (!section) {
        section = document.createElement("div");
        section.className = "provider-section";
        section.id = "provider-section-" + providerKey;
        section.style.display = "contents";
        container.appendChild(section);
    }

    if (isLoadMoreFetch) {
        // Load More in grouped mode:
        // The API returns a cumulative list for this provider.
        // Use the previously stored groupedState for this provider (if any).
        const previousCount = groupedState[providerKey] ? groupedState[providerKey].length : 0;
        const cumulativeRows = transformData(data.items);
        // Determine new rows: those beyond the previous count.
        const newRows = cumulativeRows.slice(previousCount);
        // Sort new rows if necessary.
        newRows.sort( (a, b) => sortItems(a, b));
        newRows.forEach( (item) => {
            section.appendChild(createNewRow(item, svgIcons));
        }
        );
        // Update groupedState for this provider.
        if (!groupedState[providerKey]) {
            groupedState[providerKey] = [];
        }
        groupedState[providerKey] = groupedState[providerKey].concat(newRows);
        // Update the provider’s counter using the API’s cumulative values.
        counter[providerKey] = {
            showing: data.itemsReceived,
            total: data.itemsTotal,
        };
    } else {
        // Initial grouped fetch (or switching back to grouped mode):
        // Clear the section and render all rows for this provider.
        section.innerHTML = "";
        const rows = transformData(data.items);
        rows.sort( (a, b) => sortItems(a, b));
        rows.forEach( (item) => {
            section.appendChild(createNewRow(item, svgIcons));
        }
        );
        // Save the result into groupedState.
        groupedState[providerKey] = rows;
        counter[providerKey] = {
            showing: data.itemsReceived,
            total: data.itemsTotal,
        };
    }

    // Recalculate global counters by summing over provider keys (exclude "all")
    const providerKeys = Object.keys(counter).filter( (key) => key !== "all");
    counter.all.showing = providerKeys.reduce( (sum, key) => sum + counter[key].showing, 0);
    counter.all.total = providerKeys.reduce( (sum, key) => sum + counter[key].total, 0);

    console.log(`> (Grouped Mode): Showing ${counter.all.showing} of ${counter.all.total}`);
    updateOverallCounters();

    // Append (or re-append) the load-more button for this provider if more items are available.
    const typeMapping = {
        us_based_telehealth: "Online Clinics",
        international_telehealth: "International Online Clinics",
        websites_that_sell_pills: "Websites that sell pills",
        community_networks: "Community Networks",
    };
    const label = typeMapping[providerKey] || providerKey;
    let existingBtn = document.getElementById("loadMore-" + providerKey);
    if (existingBtn)
        existingBtn.remove();
    if (data.itemsReceived < data.itemsTotal) {
        section.appendChild(createLoadMoreButton({
            type: providerKey,
            loadMoreLabel: `MORE ${label.toUpperCase()}`,
        }));
    }

    appendBackToTopButton();
    attachRowListeners();

    // Attach popup and row listeners (unchanged below)
    const popups = document.querySelectorAll('a[href*="#popup_"]');
    popups.forEach(function(popup) {
        popup.addEventListener("click", function(e) {
            e.preventDefault();
            const href = e.currentTarget.href;
            let type = href.slice(href.indexOf("_") + 1);
            if (type === "outlink")
                type = "popup-outlink";
            const p = document.querySelector("#" + type);
            if (p)
                p.style.display = "flex";
        });
    });

    const resultRows = document.querySelectorAll(".states_result_stats");
    resultRows.forEach(function(row) {
        if (!row.hasAttribute("data-listener-attached")) {
            let panel = row.nextElementSibling;
            row.addEventListener("click", function() {
                this.classList.toggle("active");
                const chevronMainBtn = this.querySelector(".chevronMain");
                const chevronMobileBtn = this.querySelector(".chevronMobile");
                if (chevronMainBtn && chevronMobileBtn && panel) {
                    const chevronDetailsEl = panel.querySelector(".chevronDetails");
                    chevronMainBtn.classList.toggle("is-open");
                    chevronMobileBtn.classList.toggle("is-open");
                    chevronDetailsEl.classList.toggle("is-open");
                    panel.classList.toggle("is-open");
                }
            });
            if (panel) {
                const chevronDetailsEl = panel.querySelector(".chevronDetails");
                const chevronMainBtn = row.querySelector(".chevronMain");
                const chevronMobileBtn = row.querySelector(".chevronMobile");
                if (chevronDetailsEl && chevronMainBtn && chevronMobileBtn) {
                    chevronDetailsEl.addEventListener("click", function(event) {
                        event.stopPropagation();
                        if (window.innerWidth < 600) {
                            chevronMobileBtn.click();
                        } else {
                            chevronMainBtn.click();
                        }
                    });
                }
            }
            row.setAttribute("data-listener-attached", "true");
        }
    });
}

function updateOverallCounters() {
    const totalResultsLabelEl = document.querySelector(".states_info_h1.is-main");
    if (totalResultsLabelEl) {
        totalResultsLabelEl.innerText = `${counter.all.total} Results`;
    }
    const resultsInfoEl = document.querySelector(".states_info_text.hide-mobile-landscape");
    if (resultsInfoEl) {
        const spanEl = resultsInfoEl.querySelector("span.states_info_text.is-grey");
        if (spanEl) {
            spanEl.nextSibling.nodeValue = `${counter.all.showing} of ${counter.all.total} Results`;
        }
    }
}

function attachRowListeners() {
    const resultRows = document.querySelectorAll(".states_result_stats");
    resultRows.forEach(function(row) {
        if (!row.hasAttribute("data-listener-attached")) {
            let panel = row.nextElementSibling;
            row.addEventListener("click", function() {
                this.classList.toggle("active");
                const chevronMainBtn = this.querySelector(".chevronMain");
                const chevronMobileBtn = this.querySelector(".chevronMobile");
                if (chevronMainBtn && chevronMobileBtn && panel) {
                    const chevronDetailsEl = panel.querySelector(".chevronDetails");
                    chevronMainBtn.classList.toggle("is-open");
                    chevronMobileBtn.classList.toggle("is-open");
                    if (chevronDetailsEl) {
                        chevronDetailsEl.classList.toggle("is-open");
                    }
                    panel.classList.toggle("is-open");
                }
            });
            if (panel) {
                const chevronDetailsEl = panel.querySelector(".chevronDetails");
                const chevronMainBtn = row.querySelector(".chevronMain");
                const chevronMobileBtn = row.querySelector(".chevronMobile");
                if (chevronDetailsEl && chevronMainBtn && chevronMobileBtn) {
                    chevronDetailsEl.addEventListener("click", function(event) {
                        event.stopPropagation();
                        if (window.innerWidth < 600) {
                            chevronMobileBtn.click();
                        } else {
                            chevronMainBtn.click();
                        }
                    });
                }
            }
            row.setAttribute("data-listener-attached", "true");
        }
    });
}

