function createLoadMoreButton(item) {
    const itemUniqueId = `loadMore-${item.type}`;
    if (!document.getElementById(itemUniqueId)) {
        const buttonText = item.loadMoreLabel;
        const loadMoreContainer = document.createElement("div");
        loadMoreContainer.className = "states_result_load-more";
        loadMoreContainer.id = itemUniqueId;

        const loadMoreLink = document.createElement("a");
        loadMoreLink.setAttribute("data-load-more-button", "true");
        loadMoreLink.href = "#";
        loadMoreLink.className = "button-tertiary is-result w-inline-block";

        const buttonIconDiv = document.createElement("div");
        buttonIconDiv.className = "button-icon size-16 w-embed";
        const svgIcon = `<svg aria-hidden="true" role="img" fill="currentColor" width="100%" height="100%" viewBox="0 0 16 16" xmlns="http://www.w3.org/2000/svg">
      <title>Arrow Right</title>
      <path fill-rule="evenodd" clip-rule="evenodd" d="M8 1.5C4.41015 1.5 1.5 4.41015 1.5 8C1.5 11.5899 4.41015 14.5 8 14.5C11.5899 14.5 14.5 11.5899 14.5 8C14.5 4.41015 11.5899 1.5 8 1.5ZM0.5 8C0.5 3.85786 3.85786 0.5 8 0.5C12.1421 0.5 15.5 3.85786 15.5 8C15.5 12.1421 12.1421 15.5 8 15.5C3.85786 15.5 0.5 12.1421 0.5 8Z"></path>
      <path fill-rule="evenodd" clip-rule="evenodd" d="M8 4C8.14304 4 8.28022 4.05682 8.38136 4.15796L11.842 7.61864C12.0527 7.82926 12.0527 8.17074 11.842 8.38136C11.6314 8.59198 11.2899 8.59198 11.0793 8.38136L8.53933 5.84137V11.4607C8.53933 11.7585 8.29786 12 8 12C7.70214 12 7.46067 11.7585 7.46067 11.4607V5.84137L4.92069 8.38136C4.71007 8.59198 4.36858 8.59198 4.15796 8.38136C3.94735 8.17074 3.94735 7.82926 4.15796 7.61864L7.61864 4.15796C7.71978 4.05682 7.85696 4 8 4Z"></path>
    </svg>`;
        buttonIconDiv.innerHTML = svgIcon;

        const buttonTextDiv = document.createElement("div");
        buttonTextDiv.className = "button-text";
        buttonTextDiv.textContent = buttonText;

        loadMoreLink.appendChild(buttonIconDiv);
        loadMoreLink.appendChild(buttonTextDiv);
        loadMoreContainer.appendChild(loadMoreLink);

        loadMoreLink.addEventListener("click", (e) => {
            e.preventDefault();
            let itemType = item.type;
            // Increase the payload amount by the defined increment
            payload.type_and_amount.amount += ITEMS_INCREMENT;
            payload.type_and_amount.type = itemType;
            console.log("createLoadMoreBtn | Updated payload amount:", payload.type_and_amount.amount);
            fetchSuppliers(payload, true);
        }
        );
        return loadMoreContainer;
    }
    return document.getElementById(itemUniqueId);
}

