function fetchAllProviderTypesWithFilters() {
    const container = document.querySelector(".states_result_component-wrapper.is-main .states_result_component");
    container.innerHTML = "";
    // Clear previous results

    const providerTypes = [{
        type: "us_based_telehealth",
        label: "Online Clinics"
    }, {
        type: "international_telehealth",
        label: "International Online Clinics"
    }, {
        type: "websites_that_sell_pills",
        label: "Websites that sell pills"
    }, {
        type: "community_networks",
        label: "Community Networks"
    }, ];

    Promise.all(providerTypes.map( (provider) => {
        const providerPayload = {
            ...payload
        };
        providerPayload.type_and_amount.type = provider.type;
        providerPayload.type_and_amount.amount = ITEMS_INCREMENT;

        return fetchSuppliers(providerPayload, false, false).then( (data) => {
            if (data.items && data.items.length > 0) {
                console.log("provider.type:", provider.type);
                counter[provider.type].showing += data.itemsReceived;
                counter[provider.type].total += data.itemsTotal;

                let section = document.getElementById(`provider-section-${provider.type}`);
                if (!section) {
                    section = document.createElement("div");
                    section.className = "provider-section";
                    section.id = `provider-section-${provider.type}`;
                    section.style.display = "contents";
                    container.appendChild(section);
                } else {
                    section.innerHTML = "";
                }

                const items = transformData(data.items);
                items.sort( (a, b) => sortItems(a, b));
                items.forEach( (item) => {
                    section.appendChild(createNewRow(item, svgIcons));
                }
                );

                counter[provider.type] = {
                    showing: data.itemsReceived,
                    total: data.itemsTotal,
                };

                if (data.itemsReceived < data.itemsTotal) {
                    section.appendChild(createLoadMoreButton({
                        type: provider.type,
                        loadMoreLabel: `MORE ${provider.label.toUpperCase()}`,
                    }));
                }
            }
        }
        ).catch( (error) => console.error(`Error fetching ${provider.type}:`, error));
    }
    )).then( () => {
        updateOverallCounters();
        appendBackToTopButton();
        attachRowListeners();
    }
    );
}

function applyFilters() {
    const isSortByProviderType = payload.sorting.sortColumn !== "price_integer" && payload.sorting.sortColumn !== "delivery_integer";

    if (isSortByProviderType) {
        counter.all.showing = 0;
        counter.all.total = 0;
        fetchAllProviderTypesWithFilters();
    } else {
        payload.type_and_amount.type = "all";
        payload.type_and_amount.amount = counter.all.showing;
        console.log("applyFilters | Updated payload amount:", payload.type_and_amount.amount);

        counter.all.showing = 0;
        counter.all.total = 0;

        fetchSuppliers(payload);
    }
}

// Sorting
let sortingModeActive = false;
document.getElementById("Sort-by-4").addEventListener("change", function(event) {
    payload.type_and_amount.amount = counter.all.showing;
    switch (event.target.value) {
    case "price-asc":
        sortingModeActive = true;
        payload.sorting.orderBy = "asc";
        payload.sorting.sortColumn = "price_integer";
        payload.type_and_amount.type = "all";
        fetchSuppliers(payload);
        break;
    case "name-asc":
        sortingModeActive = false;
        payload.sorting.orderBy = "asc";
        payload.sorting.sortColumn = "name";
        fetchAllProviderTypesWithFilters();
        break;
    case "deliveryTime-asc":
        sortingModeActive = true;
        payload.sorting.orderBy = "asc";
        payload.sorting.sortColumn = "delivery_integer";
        payload.type_and_amount.type = "all";
        fetchSuppliers(payload);
        break;
    }
});

