    if (lookingForLabel)
        lookingForLabel.innerText = selectedText;
    const svgContainerEl = document.querySelectorAll("#need-icon-1");
    switch (selectedText) {
    case "Abortion pills as soon as possible":
        payload.looking_for = selectedText;
        if (svgContainerEl) {// svgContainerEl.innerHTML = svgIcons.abortionPillsAsap;
        } else {
            console.error("'Looking for' svg container not found.");
        }
        break;
    case "Pills now in case of future need":
        payload.looking_for = selectedText;
        if (svgContainerEl) {
            svgContainerEl.innerHTML = svgIcons.pillsNow;
        } else {
            console.error("'Looking for' svg container not found.");
        }
        break;
    case "A pill for a late period":
        payload.looking_for = selectedText;
        if (svgContainerEl) {
            svgContainerEl.innerHTML = svgIcons.pillsForALatePeriod;
        } else {
            console.error("'Looking for' svg container not found.");
        }
        break;
    }

